selector_to_html = {"a[href=\"process.html#output-format\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">Formato Di Output<a class=\"headerlink\" href=\"#output-format\" title=\"Link to this heading\">#</a></h2><p>Per modificare il formato di trasmissione dati di ricerca, scansiona uno degli otto codici a barre corrispondenti al formato desiderato.</p>", "a[href=\"system.html#battery-information\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">Informazioni Batteria<a class=\"headerlink\" href=\"#battery-information\" title=\"Link to this heading\">#</a></h2>", "a[href=\"system.html\"]": "<h1 class=\"tippy-header\" style=\"margin-top: 0;\">Impostazioni Di Sistema<a class=\"headerlink\" href=\"#system-settings\" title=\"Link to this heading\">#</a></h1><h2>Ripristina Impostazioni Predefinite<a class=\"headerlink\" href=\"#restore-default-settings\" title=\"Link to this heading\">#</a></h2><p>Quando si verifica un errore sconosciuto sullo scanner, \u00e8 possibile ripristinare lo scanner ripristinando le impostazioni predefinite.</p>", "a[href=\"system.html#get-firmware-version\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">Ottieni Versione Firmware<a class=\"headerlink\" href=\"#get-firmware-version\" title=\"Link to this heading\">#</a></h2>", "a[href=\"process.html#quick-setup\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">Configurazione Rapida<a class=\"headerlink\" href=\"#quick-setup\" title=\"Link to this heading\">#</a></h2><h3>Aggiungi Prefisso<a class=\"headerlink\" href=\"#id3\" title=\"Link to this heading\">#</a></h3>", "a[href=\"system.html#sleep-time\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">Tempo Di Sospensione<a class=\"headerlink\" href=\"#sleep-time\" title=\"Link to this heading\">#</a></h2><p>Scansionando il seguente codice impostazione, \u00e8 possibile impostare lo scanner per entrare in modalit\u00e0 sospensione dopo un certo periodo di tempo quando non viene scansionato alcun codice, in modo da ridurre il consumo energetico.</p>", "a[href=\"process.html#prefix\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">Prefisso<a class=\"headerlink\" href=\"#prefix\" title=\"Link to this heading\">#</a></h2><h3>Aggiungi Prefisso<a class=\"headerlink\" href=\"#add-prefix\" title=\"Link to this heading\">#</a></h3>", "a[href=\"wireless.html#one-to-one-pairing\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">Abbinamento Uno-Unico<a class=\"headerlink\" href=\"#one-to-one-pairing\" title=\"Link to this heading\">#</a></h2>", "a[href=\"working.html#normal-mode\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">Modalit\u00e0 Normale<a class=\"headerlink\" href=\"#normal-mode\" title=\"Link to this heading\">#</a></h2>", "a[href=\"process.html#suffix\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">Suffix<a class=\"headerlink\" href=\"#suffix\" title=\"Link to this heading\">#</a></h2><h3>Aggiungi Suffisso<a class=\"headerlink\" href=\"#add-suffix\" title=\"Link to this heading\">#</a></h3>", "a[href=\"working.html#storage-mode\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">Modalit\u00e0 Di Archiviazione<a class=\"headerlink\" href=\"#storage-mode\" title=\"Link to this heading\">#</a></h2><h3>Caricamento Dati<a class=\"footnote-reference brackets\" href=\"#id2\" id=\"id1\" role=\"doc-noteref\"><span class=\"fn-bracket\">[</span>1<span class=\"fn-bracket\">]</span></a><a class=\"headerlink\" href=\"#data-upload1\" title=\"Link to this heading\">#</a></h3>", "a[href=\"process.html#appendix\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">Appendice<a class=\"headerlink\" href=\"#appendix\" title=\"Link to this heading\">#</a></h2><h3>Codici A Barra Numerici<a class=\"headerlink\" href=\"#numeric-bar-codes\" title=\"Link to this heading\">#</a></h3>", "a[href=\"keyboard.html#case-settings\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">Impostazioni Caso<a class=\"headerlink\" href=\"#case-settings\" title=\"Link to this heading\">#</a></h2><h3>Normale<a class=\"headerlink\" href=\"#normal\" title=\"Link to this heading\">#</a></h3>", "a[href=\"system.html#restore-default-settings\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">Ripristina Impostazioni Predefinite<a class=\"headerlink\" href=\"#restore-default-settings\" title=\"Link to this heading\">#</a></h2><p>Quando si verifica un errore sconosciuto sullo scanner, \u00e8 possibile ripristinare lo scanner ripristinando le impostazioni predefinite.</p>", "a[href=\"process.html\"]": "<h1 class=\"tippy-header\" style=\"margin-top: 0;\">Modifica Dati<a class=\"headerlink\" href=\"#data-editing\" title=\"Link to this heading\">#</a></h1><h2>Formato Di Output<a class=\"headerlink\" href=\"#output-format\" title=\"Link to this heading\">#</a></h2><p>Per modificare il formato di trasmissione dati di ricerca, scansiona uno degli otto codici a barre corrispondenti al formato desiderato.</p>", "a[href=\"wireless.html#medium-speed\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">Velocit\u00e0 Media<a class=\"headerlink\" href=\"#medium-speed\" title=\"Link to this heading\">#</a></h2>", "a[href=\"working.html\"]": "<h1 class=\"tippy-header\" style=\"margin-top: 0;\">Modalit\u00e0 Di Lavoro<a class=\"headerlink\" href=\"#working-mode\" title=\"Link to this heading\">#</a></h1><p>Nella zona di lavoro al di fuori della gamma di 2. Ricevitore G o segnale Bluetooth, \u00e8 possibile attivare la modalit\u00e0 di archiviazione dello scanner seguendo i passaggi descritti di seguito. In questa modalit\u00e0, tutti i dati scansionati saranno memorizzati direttamente nello scanner. Prima di caricare i dati, verr\u00e0 salvato in modo permanente nello scanner in modo da poter caricare i dati quando lo scanner \u00e8 nell\u2019intervallo di segnale di ricezione.</p>", "a[href=\"process.html#hide-set\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">Nascondi Set<a class=\"headerlink\" href=\"#hide-set\" title=\"Link to this heading\">#</a></h2><h3>Nascondi Barcode Start Chars<a class=\"headerlink\" href=\"#hide-barcode-start-chars\" title=\"Link to this heading\">#</a></h3>", "a[href=\"wireless.html#high-speed\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">Alta Velocit\u00e0<a class=\"headerlink\" href=\"#high-speed\" title=\"Link to this heading\">#</a></h2>", "a[href=\"system.html#volume-settings\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">Impostazioni Volume<a class=\"headerlink\" href=\"#volume-settings\" title=\"Link to this heading\">#</a></h2><p>Scansiona il codice di impostazione corrispondente per attivare/disattivare il prompt del suono dello scanner</p>", "a[href=\"keyboard.html\"]": "<h1 class=\"tippy-header\" style=\"margin-top: 0;\">Impostazioni Tastiera<a class=\"headerlink\" href=\"#keyboard-settings\" title=\"Link to this heading\">#</a></h1><h2>Impostazioni Caso<a class=\"headerlink\" href=\"#case-settings\" title=\"Link to this heading\">#</a></h2><h3>Normale<a class=\"headerlink\" href=\"#normal\" title=\"Link to this heading\">#</a></h3>", "a[href=\"keyboard.html#keyboard-language\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">Lingua Della Tastiera<a class=\"headerlink\" href=\"#keyboard-language\" title=\"Link to this heading\">#</a></h2><h3>Ottieni Lingua Della Tastiera Attuale<a class=\"headerlink\" href=\"#get-current-keyboard-language\" title=\"Link to this heading\">#</a></h3>", "a[href=\"wireless.html\"]": "<h1 class=\"tippy-header\" style=\"margin-top: 0;\">Modalit\u00e0 Wireless<a class=\"headerlink\" href=\"#wireless-mode\" title=\"Link to this heading\">#</a></h1><p>Questa modalit\u00e0 utilizza il 2. banda di frequenza GHz per la trasmissione di dati e si basa sulla tecnologia di radiofrequenza (RF), che si collega al computer tramite un ricevitore USB e consente allo scanner di muoversi liberamente entro una certa distanza.</p>", "a[href=\"wireless.html#low-speed\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">Bassa Velocit\u00e0<a class=\"headerlink\" href=\"#low-speed\" title=\"Link to this heading\">#</a></h2>", "a[href=\"#wx-rf-wireless-scanner-quick-setup-guide\"]": "<h1 class=\"tippy-header\" style=\"margin-top: 0;\">Guida Di Configurazione Rapida <strong>WX-RF</strong> Wireless Scanner<a class=\"headerlink\" href=\"#wx-rf-wireless-scanner-quick-setup-guide\" title=\"Link to this heading\">#</a></h1>", "a[href=\"wireless.html#receiver-keyboard-transmission-speed1\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">Velocit\u00e0 Di Trasmissione Tastiera Ricevitore<a class=\"footnote-reference brackets\" href=\"#id2\" id=\"id1\" role=\"doc-noteref\"><span class=\"fn-bracket\">[</span>1<span class=\"fn-bracket\">]</span></a><a class=\"headerlink\" href=\"#receiver-keyboard-transmission-speed1\" title=\"Link to this heading\">#</a></h2>"}
skip_classes = ["headerlink", "sd-stretched-link", "sd-rounded-pill"]

window.onload = function () {
    for (const [select, tip_html] of Object.entries(selector_to_html)) {
        const links = document.querySelectorAll(`article.bd-article ${select}`);
        for (const link of links) {
            if (skip_classes.some(c => link.classList.contains(c))) {
                continue;
            }

            tippy(link, {
                content: tip_html,
                allowHTML: true,
                arrow: true,
                placement: 'auto-start', maxWidth: 500, interactive: false,

            });
        };
    };
    console.log("tippy tips loaded!");
};
